import React from "react";
import styled from "styled-components";

function Menu() {
    return(
        <MenuStyled>
            <div className="buttons">
                <div className="button">
                    <div className="circle">
                    </div>
                    Light
                </div>
            </div>
        </MenuStyled>
    )
}

const MenuStyled = styled.div`
    display: flex;
    justify-content: center;
    height: 10vh;
    align-items: center;

    .buttons{
        background-color: var(--btn-color);
        padding: 1rem 2rem;
        .button{
            display: flex;
            align-items: center;
            cursor: pointer;
            &:not(:last-child){
                margin-right: 2rem;
            }
            .circle{
                width: 1.5rem;
                height: 1.5rem;
                border-radius: 50%;
                background-color: var(--circle-color);
                bodrder: 2px solid var(--border);
            }
        }
    }
`;

export default Menu;
